import React, { useState, useEffect } from 'react';
import getData from '../../api/endpoint';
import { FiCalendar, FiClock, FiUser } from 'react-icons/fi';

const MesRendezVous = () => {
  const [rendezVous, setRendezVous] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    loadRendezVous();
  }, []);

  const loadRendezVous = async () => {
    try {
      setLoading(true);
      setError(null);
      const token = localStorage.getItem('token');
      if (token) {
        const decoded = JSON.parse(atob(token.split('.')[1]));
        const data = await getData('/rendezvous');
        const mesRdv = data.filter(rdv => rdv.medecinId === decoded.userId);
        setRendezVous(mesRdv);
      }
    } catch (err) {
      console.error('Erreur lors du chargement des rendez-vous:', err);
      setError('Impossible de charger les rendez-vous.');
      setRendezVous([]);
    } finally {
      setLoading(false);
    }
  };

  const getStatusColor = (statut) => {
    switch (statut) {
      case 'CONFIRME': return 'bg-green-100 text-green-800';
      case 'EN_ATTENTE': return 'bg-yellow-100 text-yellow-800';
      case 'ANNULE': return 'bg-red-100 text-red-800';
      default: return 'bg-gray-100 text-gray-800';
    }
  };

  if (loading) {
    return (
      <div className="flex items-center justify-center h-64">
        <div className="text-gray-600">Chargement...</div>
      </div>
    );
  }

  return (
    <div>
      <div className="mb-8">
        <h2 className="text-3xl font-bold text-gray-900">Mes Rendez-vous</h2>
        <p className="text-gray-600 mt-2">Gérez vos rendez-vous avec les patients</p>
      </div>

      {error && (
        <div className="bg-red-50 border border-red-200 text-red-700 px-4 py-3 rounded mb-6">
          {error}
        </div>
      )}

      {rendezVous.length === 0 ? (
        <div className="bg-white rounded-2xl shadow-lg p-12 text-center border border-gray-100">
          <FiCalendar size={48} className="mx-auto text-gray-400 mb-4" />
          <h3 className="text-xl font-semibold text-gray-900 mb-2">Aucun rendez-vous</h3>
          <p className="text-gray-600">Vous n'avez pas encore de rendez-vous programmé.</p>
        </div>
      ) : (
        <div className="grid grid-cols-1 gap-6">
          {rendezVous.map((rdv) => (
            <div key={rdv._id} className="bg-white rounded-2xl shadow-lg p-6 border border-gray-100 hover:shadow-xl transition-all">
              <div className="flex items-start justify-between">
                <div className="flex-1">
                  <div className="flex items-center mb-3">
                    <FiCalendar className="text-blue-500 mr-2" size={20} />
                    <h3 className="text-xl font-bold text-gray-900">{rdv.motif || 'Rendez-vous médical'}</h3>
                  </div>
                  
                  <div className="space-y-2 text-gray-600">
                    <div className="flex items-center">
                      <FiClock className="mr-2" size={16} />
                      <span>{new Date(rdv.dateRendezVous).toLocaleDateString('fr-FR', { 
                        weekday: 'long', 
                        year: 'numeric', 
                        month: 'long', 
                        day: 'numeric',
                        hour: '2-digit',
                        minute: '2-digit'
                      })}</span>
                    </div>
                    
                    {rdv.patientId && (
                      <div className="flex items-center">
                        <FiUser className="mr-2" size={16} />
                        <span>Patient: {rdv.patientId.fullName || 'Non spécifié'}</span>
                      </div>
                    )}
                  </div>
                </div>
                
                <span className={`px-3 py-1 rounded-full text-sm font-medium ${getStatusColor(rdv.statut)}`}>
                  {rdv.statut || 'EN_ATTENTE'}
                </span>
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default MesRendezVous;
